import React from "react";
import './style.css';

const info = () => (
    <div className="info">
        <h1>Bem vindo(a) ao seu portal de noticias!</h1>
        <p>Apresentamos conteúdos sobre a natureza e os animais em nosso site de notícias, trazendo informações relevantes sobre ecologia, conservação, biodiversidade, comportamento animal e curiosidades do mundo natural. Você encontrará artigos e reportagens sobre os ecossistemas, animais silvestres e domésticos, suas relações e interações no ambiente, além de dicas sobre como preservar e cuidar do meio ambiente.
            Mantenha-se informado e descubra as maravilhas da natureza e dos animais conosco.</p>
    </div>
);

export default info;
